#include <iostream>
#include <string>
#include <map>


using namespace std;

class Solution {
public:
    bool checkInclusion(string s1, string s2) {
        size_t s1_size = s1.size();
        size_t s2_size = s2.size();
        if (s1_size <= 0 || s2_size <= 0 || s2_size < s1_size)
        {
            return false;
        }
        if (s1_size == s2_size && s1_size == 1)
        {
            if(s1[0] == s2[0]) 
            {
                return true;
            } 
            else
            {
                return false;
            }
        }
        multimap<char,int> s1_map; /// key:char value:yes or no
        for (string::const_iterator itr = s1.begin(); itr != s1.end(); ++itr)
        {
            s1_map.insert(make_pair(*itr,1));
        }
        int tail = 0;
        for (int lead = s1_size - 1; lead < s2_size;lead++,tail++ )
        {
            string subStr = s2.substr(tail, lead+1);
            multimap<char, int> tmp_map = s1_map;
            for(string::const_iterator itr = subStr.begin(); itr != subStr.end(); ++itr) 
            {
                if(tmp_map.size() <= 0) {
                    return true;
                }
                multimap<char,int>::iterator map_itr = tmp_map.find(*itr);
                if (map_itr != tmp_map.end())
                {
                    tmp_map.erase(map_itr);
                }
                else 
                {
                    break;
                }
            }
            if(tmp_map.size() <= 0) {
                return true;
            }
        }
        return false;
    }
};

int main(int argc, const char* argv[]) {
    Solution s;
    /// ccc cabc
    /// ab ba
    /// a ab
    /// ab  eidbaooo
    /// ab eidboaoo
    /*
    ""
""
    */
    bool result = s.checkInclusion("","");
    cout<<result<<endl;
    return 0;
}